<?phpnamespace App\Livewire\User;use App\Models\User;use Illuminate\Contracts\View\View;use Livewire\Attributes\Title;use Livewire\Component;#[Title('users')]class Profile extends Component{    /**     * Current user     * @var User $user     */    public User $user;    /**     * Front-End data bag     * @return array     */    public function bag(): array    {        return [            'users' => User::all()        ];    }    /**     * Render the component view     * @return View     */    public function render(): View    {        return view('livewire.user.profile', $this->bag())->layout('components.layouts.with-navigation ');    }}